webpackJsonp([0xb19e97cf0726],{1037:function(a,t){a.exports={data:{nodePost:{title:"DrupalEasy Podcast 205 - Fatima Khalid - First time sprinter's guide",link:"https://www.drupaleasy.com/podcast/2018/02/drupaleasy-podcast-205-fatima-khalid-first-time-sprinters-guide",body:{value:'<blockquote>\r\nFatima Khalid (<a href="https://www.drupal.org/u/sugaroverflow">sugaroverflow</a>), web developer with <a href="https://www.echidna.ca/">Digital Echidna</a>, and DrupalCon Nashville track chair and sprint mentor joins Mike Anello to talk about how to be a first-time sprinter at a local Drupal event or a DrupalCon and how she came for the community and stayed for the code.\r\n</blockquote>\r\n\r\n<p>Thought this was a really fun and accessible overview of what a sprint is like. I found them very intimidating at first and I think hearing an overview like this in advance would have helped.  Don\'t know how many first time sprinters are avid listeners of Drupal podcasts, but any little bit helps.<p>'},created:1518647919}},pathContext:{slug:"/link/drupaleasy-podcast-205-fatima-khalid-first-time-sprinter's-guide/"}}}});
